// Функция для извлечения путей из сырых SVG данных
function extractPathsFromSVG(rawSvgData) {
    const paths = [];

    // Регулярное выражение для поиска всех d="..." атрибутов
    const pathRegex = /d="([^"]+)"/g;
    let match;

    while ((match = pathRegex.exec(rawSvgData)) !== null) {
        paths.push(match[1]);
    }

    console.log('🎨 Extracted', paths.length, 'paths from SVG data');
    return paths;
}

// Автоматическое извлечение путей
const SIGNATURE_PATHS = extractPathsFromSVG(RAW_SVG_DATA);

// Автозагрузка подписи
(function() {
    if (document.readyState === 'loading') {
        document.addEventListener('DOMContentLoaded', initSignature);
    } else {
        initSignature();
    }

    function initSignature() {
        // Ждем пока основная страница загрузится
        function waitForFunction() {
            if (typeof window.loadSignatureData === 'function') {
                console.log('🎨 Loading signature with', SIGNATURE_PATHS.length, 'paths');
                window.loadSignatureData(SIGNATURE_PATHS);
            } else {
                console.log('⏳ Waiting for loadSignatureData function...');
                setTimeout(waitForFunction, 500);
            }
        }

        setTimeout(() => {
            waitForFunction();
        }, 1000);
    }
})();